import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Presentation from "./fiche_appel/AttendanceTable/presentation";


function App() {

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/presentation" element={<Presentation />} />

        {/* /**<Route path="*" element={< />} /> */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
